def _norm_email(s): return (s or "").strip().lower()

def machine_fingerprint():
    fp_parts = []
    try:
        if platform.system().lower().startswith("win"):
            import winreg
            key = winreg.OpenKey(winreg.HKEY_LOCAL_MACHINE, r"SOFTWARE\\Microsoft\\Cryptography", 0, winreg.KEY_READ | getattr(winreg, "KEY_WOW64_64KEY", 0))
            val, _ = winreg.QueryValueEx(key, "MachineGuid")
            fp_parts.append(val)
    except Exception:
        pass
    try: fp_parts.append(platform.node())
    except Exception: pass
    try: fp_parts.append(hex(uuid.getnode()))
    except Exception: pass
    base = "|".join([p for p in fp_parts if p]) or "unknown-machine"
    return hashlib.sha256(base.encode("utf-8")).hexdigest()

def sign_state(data):
    fields = [
        machine_fingerprint(),
        data.get("trial_start",""),
        data.get("last_run",""),
        str(data.get("days_accum",0)),
        data.get("license_code",""),
        PRODUCT_TAG,
    ]
    msg = "|".join(fields).encode("utf-8")
    return hmac.new(SECRET.encode("utf-8"), msg, hashlib.sha256).hexdigest()

def load_state_file(path):
    if not os.path.exists(path): return None
    try:
        with open(path, "r", encoding="utf-8") as f: return json.load(f)
    except Exception: return None

def save_state_to(path, data):
    try:
        with open(path, "w", encoding="utf-8") as f: json.dump(data, f, ensure_ascii=False, indent=2)
        return True
    except Exception:
        return False

def merge_states(primary, shadow):
    out = {}
    def pick_min_date(a,b):
        if not a: return b
        if not b: return a
        return a if a <= b else b
    def pick_max_date(a,b):
        if not a: return b
        if not b: return a
        return a if a >= b else b
    def pick_max_int(a,b):
        try: ai = int(a)
        except: ai = 0
        try: bi = int(b)
        except: bi = 0
        return ai if ai>=bi else bi
    out["trial_start"] = pick_min_date(primary.get("trial_start"), shadow.get("trial_start"))
    out["last_run"]   = pick_max_date(primary.get("last_run"),   shadow.get("last_run"))
    out["days_accum"] = pick_max_int(primary.get("days_accum"),  shadow.get("days_accum"))
    lic = primary.get("license_code") or shadow.get("license_code") or ""
    out["license_code"] = lic
    out["licensed_email"] = primary.get("licensed_email") or shadow.get("licensed_email") or ""
    out["licensed_on"] = primary.get("licensed_on") or shadow.get("licensed_on") or ""
    return out

def verify_sig(S):
    sig = S.get("sig",""); calc = sign_state(S)
    return sig and sig == calc

def write_both(S):
    S["sig"] = sign_state(S)
    save_state_to(PRIMARY_STATE, S); save_state_to(SHADOW_STATE, S)

def init_or_load_state():
    today = datetime.date.today().isoformat()
    P = load_state_file(PRIMARY_STATE) or {}
    Q = load_state_file(SHADOW_STATE) or {}
    if P and not verify_sig(P): P = {}
    if Q and not verify_sig(Q): Q = {}
    if not P and not Q:
        S = {"trial_start": today, "last_run": today, "days_accum": 0, "license_code": ""}
        write_both(S); return S
    S = merge_states(P, Q)
    if not S.get("trial_start"): S["trial_start"] = today
    if not S.get("last_run"): S["last_run"] = today
    if "days_accum" not in S: S["days_accum"] = 0
    write_both(S); return S

def update_run_and_check_expiry(S):
    today = datetime.date.today()
    try: last = datetime.date.fromisoformat(S.get("last_run",""))
    except Exception: last = today
    if today < last:
        S["tamper"] = True; S["days_accum"] = TRIAL_DAYS + 999
        S["last_run"] = today.isoformat(); write_both(S); return True
    delta = (today - last).days
    if delta > 0:
        S["days_accum"] = int(S.get("days_accum",0)) + delta
        S["last_run"] = today.isoformat(); write_both(S)
    return int(S.get("days_accum",0)) >= TRIAL_DAYS

def make_sig(email, exp_compact):
    base = f"{_norm_email(email)}|{exp_compact}|{PRODUCT_TAG}".encode("utf-8")
    return hmac.new(SECRET.encode("utf-8"), base, hashlib.sha256).hexdigest()[:32]

def parse_license(code):
    if not code: return None
    m = re.match(r"^GD1[-:]([0-9]{8})[-:]([^:]+)[-:]([0-9a-fA-F]{32})$", code.strip())
    if not m: return None
    exp, email, sig = m.group(1), m.group(2), m.group(3).lower()
    want = make_sig(email, exp)
    if sig != want: return None
    try:
        y, mth, d = int(exp[:4]), int(exp[4:6]), int(exp[6:])
        expiry_date = datetime.date(y, mth, d)
    except Exception:
        return None
    return {"email": _norm_email(email), "expiry": expiry_date, "code": code.strip()}

def resource_path(name):
    base = getattr(sys, "_MEIPASS", os.path.abspath(os.path.dirname(sys.argv[0])))
    p = os.path.join(base, name)
    if os.path.exists(p):
        return p
    if os.path.exists(name):
        return os.path.abspath(name)
    return None

def ensure_font():
    name = "Helvetica"
    ttf_path = resource_path(DEFAULT_FONT_FILE)
    if ttf_path:
        try:
            pdfmetrics.registerFont(TTFont("AppFont", ttf_path))
            name = "AppFont"
        except Exception:
            pass
    return name

def draw_wrapped_text(c, text, x_mm, y_mm, w_mm, line_h_pt=12.6, font="Helvetica", size=10.5):
    if not text or not str(text).strip(): return
    from reportlab.pdfbase.pdfmetrics import stringWidth
    c.setFont(font, size)
    max_w_pt = w_mm * mm; x = x_mm * mm; y = y_mm * mm
    for raw in str(text).replace("\r","").splitlines():
        line = raw.strip()
        if not line: y -= line_h_pt; continue
        words = line.split(); cur = ""
        for w in words:
            t = (cur + " " + w).strip()
            if stringWidth(t, font, size) <= max_w_pt: cur = t
            else: c.drawString(x, y, cur); y -= line_h_pt; cur = w
        if cur: c.drawString(x, y, cur); y -= line_h_pt

def detect_template_size_mm_from_reader(reader):
    page = reader.pages[0]
    w_pt = float(page.mediabox.width); h_pt = float(page.mediabox.height)
    mm_per_pt = 25.4 / 72.0; return (w_pt * mm_per_pt, h_pt * mm_per_pt, w_pt, h_pt)

def draw_centered_text_below_box(c, text, box_xywh, font, size=9.0, offset_mm= -2.0):
    if not text or not str(text).strip(): return
    x, y, w, h = box_xywh
    cx = (x + w/2.0) * mm; ty = (y + offset_mm) * mm
    c.setFont(font, size)
    from reportlab.pdfbase.pdfmetrics import stringWidth
    width_pt = stringWidth(text, font, size)
    c.drawString(cx - width_pt/2.0, ty, text)

def create_overlay_pdf(path, coords, data, sig_paths, page_size_pt):
    c = canvas.Canvas(path, pagesize=page_size_pt)
    font = ensure_font(); c.setFont(font, 11)

    TEXT_FIELDS = [
        "izvodjac","objekat","mesto",
        "investitor","adresa","gradinv",
        "dan","datum",
        "i_od","i_do","i_uk","ii_od","ii_do","ii_uk","iii_od","iii_do","iii_uk",
        "I_grad","I_zan","I_teh","I_ost","I_uk",
        "II_grad","II_zan","II_teh","II_ost","II_uk",
        "III_grad","III_zan","III_teh","III_ost","III_uk",
        "mehanizacija_1","mehanizacija_2","mehanizacija_3",
        "u1","t1","u2","t2","u3","t3",
        "vreme_opis"
    ]
    for key in TEXT_FIELDS:
        val = data.get(key, ""); xy = coords.get(key)
        if not val or not xy: continue
        try:
            x_mm, y_mm = float(xy[0]), float(xy[1])
            c.drawString(x_mm * mm, y_mm * mm, str(val))
        except Exception:
            pass

    # OPIS/PRIM — veličina i razmak redova (leading) — cement iz coords
    opis_size = float(coords.get("opis_font_size", 10.5))
    prim_size = float(coords.get("prim_font_size", 10.5))
    opis_lh = float(coords.get("opis_line_h", round(opis_size*1.2, 2)))  # pt
    prim_lh = float(coords.get("prim_line_h", round(prim_size*1.2, 2)))  # pt

    draw_wrapped_text(c, data.get("opis",""), coords.get("opis_x",14), coords.get("opis_y",184), coords.get("opis_w",95),
                      line_h_pt=opis_lh, font=font, size=opis_size)
    draw_wrapped_text(c, data.get("prim",""), coords.get("prim_x",118), coords.get("prim_y",184), coords.get("prim_w",95),
                      line_h_pt=prim_lh, font=font, size=prim_size)

    # potpisi (slike)
    def draw_sig(img_path, key):
        if not img_path or not os.path.exists(img_path): return
        if key not in coords: return
        x, y, w, h = coords[key]
        im = Image.open(img_path); iw, ih = im.size
        scale = min((w*mm)/iw, (h*mm)/ih) if iw>0 and ih>0 else 1.0
        wpt, hpt = iw*scale, ih*scale
        c.drawImage(img_path, x*mm + (w*mm - wpt)/2, y*mm + (h*mm - hpt)/2, width=wpt, height=hpt, mask='auto')

    sig_invest_key = "sig_investitor" if "sig_investitor" in coords else ("sig_nadzor" if "sig_nadzor" in coords else "sig_investitor")
    draw_sig(sig_paths.get("vode"),      "sig_vode")
    draw_sig(sig_paths.get("izvodjac"),  "sig_izvodjac")
    draw_sig(sig_paths.get("investitor"),  sig_invest_key)

    # --- imena uz potpise ---
    NAME_XY_KEYS = {"ime_vode": "ime_vode_xy","ime_izvodjac":"ime_izvodjac_xy","ime_investitor":"ime_investitor_xy"}
    name_offset_mm = float(coords.get("name_offset_mm", 0.0))  # fiksno (0 ako nije zadato)
    for name_key, box_key in [("ime_vode","sig_vode"), ("ime_izvodjac","sig_izvodjac"), ("ime_investitor",sig_invest_key)]:
        nm = (data.get(name_key) or "").strip()
        if not nm: continue
        xy_key = NAME_XY_KEYS.get(name_key)
        xy = coords.get(xy_key)
        if isinstance(xy, list) and len(xy)>=2:
            try:
                x_mm, y_mm = float(xy[0]), float(xy[1] + name_offset_mm)
                c.setFont(font, 9.0)
                c.drawString(x_mm * mm, y_mm * mm, nm)
            except Exception:
                pass
        else:
            if box_key in coords:
                draw_centered_text_below_box(c, nm, coords[box_key], font, size=9.0, offset_mm=name_offset_mm)

    c.showPage(); c.save()

def merge_overlay(reader_base, overlay_pdf, out_pdf):
    base_page = reader_base.pages[0]
    over  = PdfReader(overlay_pdf).pages[0]
    base_page.merge_page(over)
    w = PdfWriter(); w.add_page(base_page)
    with open(out_pdf, "wb") as f: w.write(f)

# --- Licenca/trial API ---
def license_status():
    today = datetime.date.today()
    S = init_or_load_state()

    lic = S.get("license_code","").strip()
    info = parse_license(lic) if lic else None
    if info and info["expiry"] >= today:
        update_run_and_check_expiry(S)
        return {"mode":"licensed","trial_left_days":max(0, TRIAL_DAYS-int(S.get("days_accum",0))),"email":info["email"],"expiry":info["expiry"]}

    expired = update_run_and_check_expiry(S)
    left = max(0, TRIAL_DAYS - int(S.get("days_accum",0)))
    if expired:
        return {"mode":"expired","trial_left_days":0,"email":"","expiry":None}
    else:
        return {"mode":"trial","trial_left_days":left,"email":"","expiry":None}

def save_license(code):
    today = datetime.date.today()
    S = init_or_load_state()
    info = parse_license(code)
    if not info: raise ValueError("Neispravan licenčni kod.")
    if info["expiry"] < today: raise ValueError("Licenca je istekla.")
    S["license_code"] = info["code"]
    S["licensed_email"] = info["email"]
    S["licensed_on"] = today.isoformat()
    write_both(S); return info

