        # Popuni odmah iz ugrađenog default state (ako nema last_state.json)
        if not os.path.exists(STATE_PATH):
            self._apply_default_state()
            try:
                # upiši default state pored exe-a da sledeći put čita iz fajla
                self._save_state()
            except Exception:
                pass
        self._load_state(silent=True)

